"use strict";

////////////////CAROUSEL HOME PAGE START //////////////////////////
function nextSlide() {
  var slide = document.querySelectorAll('.cont-img');
  slide[0].classList.add('active');
  var nbSlides = slide.length;
  var count = 0;
  slide[count].classList.remove('active');

  if (count < nbSlides - 1) {
    count++;
  } else {
    count = 0;
  }

  slide[count].classList.add('active');
}

setInterval(nextSlide, 6000); ////////////////CAROUSEL HOME PAGE END //////////////////////////
////////////////CAROUSEL GAME PAGE START //////////////////////////

var iframe = document.getElementById('iframe');
var img = document.querySelector('.img-game');
var imgMin1 = document.getElementById('img-game-mini1');
var imgMin2 = document.getElementById('img-game-mini2');
var imgMin3 = document.getElementById('img-game-mini3');
var imgMin4 = document.getElementById('img-game-mini4');
var imgMin5 = document.getElementById('img-game-mini5');

(function changeImg() {
  imgMin1.addEventListener('click', function () {
    iframe.classList.remove('disable');
    iframe.classList.add('active');
    img.classList.remove('active');
    img.classList.add('disable');
  });
  imgMin2.addEventListener('click', function () {
    iframe.classList.remove('active');
    iframe.classList.add('disable');
    img.classList.remove('disable');
    img.classList.add('active');
    img.src = imgMin2.src;
  });
  imgMin3.addEventListener('click', function () {
    iframe.classList.remove('active');
    iframe.classList.add('disable');
    img.classList.remove('disable');
    img.classList.add('active');
    img.src = imgMin3.src;
  });
  imgMin4.addEventListener('click', function () {
    iframe.classList.remove('active');
    iframe.classList.add('disable');
    img.classList.remove('disable');
    img.classList.add('active');
    img.src = imgMin4.src;
  });
  imgMin5.addEventListener('click', function () {
    iframe.classList.remove('active');
    iframe.classList.add('disable');
    img.classList.remove('disable');
    img.classList.add('active');
    img.src = imgMin5.src;
  });
})();

